  cy: "18",
  r: "3",
  key: "1p0y38"
}], ["circle", {
  cx: "6",
  cy: "6",
  r: "3",
  key: "ey9bbu"
}], ["path", {
  d: "M13 6h3a2 2 0 012 2v7",
  key: "1qlfnd"
